    "length_of_string_exampleDesc": "[시작하기]버튼을 클릭하면 오브젝트가 \"안녕\"과 \"엔트리\"의 글자 수를 각각 2초 동안 말합니다.",
    "combine_something_desc": "A 문자열과 B 문자열을 결합한 값입니다. (A, B 중 하나가 숫자면 문자열로 바꾸어 처리되고, 둘 다 숫자면 덧셈 연산으로 처리됩니다.)",
