    "set_variable_exampleCode": "age = 16\n\ndef when_start():\n    Entry.print(age)",
    "set_variable_exampleDesc": "age라는 변수를 만들고 그 값을 16으로 정합니다. [시작하기]버튼을 클릭하면 오브젝트가 age 변수에 들어 가 있는 값인 \"16\"을 말합니다.",
